От предыдущих голосований нынешний плебисцит отличается:
1) Гораздо более раздутым надомным и интернет-голосованием через портал ГосУслуг;
2) Запретом любому гражданину становиться наблюдателем на участке (вместо этого их будет назначать Общественная палата и региональные общественные палаты), международных наблюдателей не пустят;
3) Раздутым сроком проведения самого плебисцита (целая неделя);
4)  Неблагоприятной эпидемиологической ситуацией.

Всё это не просто упрощает процедуру вбросов, а попросту исключает вести хоть какое-то наблюдение и контроль за голосованием. К тому же, возникают сомнения, что эти голоса вообще будут подсчитаны и хоть как-то учтены: Путин уже отправил на первое чтение закон "о патриотическом воспитании", который опирается на новые поправки, подписал 15 марта закон о поправках, затем его утвердил КС.

И что, думаете, даже если более 80% будет против (что ОЧЕНЬ маловероятно),  в АП увидят  "красную папку с настоящими результатами голосования"? Что помешает на участках и в интернете  фальсифицировать сколько угодно голосов за неделю бесконтрольного треша? Пойдёт один человечек, и проголосует хоть 10, хоть 100 раз, и кто его в этом уличит?

Зато увеличивается риск заражения. Коронавирус продолжает уносить жизни 50 москвичей ежедневно, а Собянин наклепал свободных коек, чтобы их увеличившийся процент позволил ему снять на некоторое время ограничения.

@Иванов Дмитрий Если мы работаем со средними показателями, то по Вашим расчётам явка составит 83человека*60минут*12часов*7дней=418320 человек на один участок. 
Всего в России 95000 участковом по данным Гугла.  418320человек*95000участков=39740400000 будет явка на выборы. Население земли около 7млрд человек. 
Даже если явка составит 145млн, то есть 100 процентов, то 145000000человек/95000участков/7дней/12часов/60 минут=0,3 человека в минуту в среднем по стране или один человек в 3 минуты.

